import {useState} from "react";
import {fetchAdress} from "../../util/Requests";
import axios from "axios";

export default function RegisterForm(props)
{
    const {loginCallback} = props

    const [login, setLogin] = useState('')
    const [password, setPassword] = useState('')
    const [firstName, setFirstName] = useState('')
    const [lastName, setLastName] = useState('')
    const [email, setEmail] = useState('')
    const [dateOfBirth, setDateOfBirth] = useState('')
    const [isRegisterFailed, setIsRegisterFailed] = useState(false)
    const [errorMessage, setErrorMessage] = useState('')

    async function handleSubmit(e)
    {
        e.preventDefault()

        setIsRegisterFailed(false)
        setErrorMessage('')
        try{
            const reguestData={
                "login":login,
                "password":password,
                "firstName":firstName,
                "lastName":lastName,
                "email":email,
                "dateOfBirth":dateOfBirth
            }
            const response=await axios.post(fetchAdress()+'User/RegisterClient',reguestData)
            console.log(response)

        }
        catch (error)
        {
            //setIsRegisterFailed(true)
            //Jeśli fetche idą na zły endpoint to to powoduje error
            //setErrorMessage(error.response.data)
            console.log(error)
        }
    }

    function handleLogin()
    {
        if (loginCallback)
            loginCallback()
    }

    return (
        <>
            <form>
                Register Page
                <label>
                    Login:
                    <input type={"text"}
                           name={"login"}
                           onChange={e => setLogin(e.target.value)}/>
                </label>
                <label>
                    Hasło:
                    <input type={"password"}
                           name={"password"}
                           onChange={e => setPassword(e.target.value)}/>
                </label>
                <label>
                    Imię:
                    <input type={"text"}
                           name={"firstName"}
                           onChange={e => setFirstName(e.target.value)}/>
                </label>
                <label>
                    Nazwisko:
                    <input type={"text"}
                           name={"lastName"}
                           onChange={e => setLastName(e.target.value)}/>
                </label>
                <label>
                    Email:
                    <input type={"email"}
                           name={"email"}
                           onChange={e => setEmail(e.target.value)}/>
                </label>
                <label>
                    Data urodzenia:
                    <input type={"date"}
                           name={"dateOfBirth"}
                           onChange={e => setDateOfBirth(e.target.value)}/>
                </label>
                <input type={"button"}
                       value={"Zarejestruj się"}
                       onClick={handleSubmit}/>
                {isRegisterFailed ? errorMessage : null}
                <input type={"button"}
                       value={"Zaloguj się"}
                       onClick={handleLogin}/>
                <input type={"button"}
                       value={"Zarejestruj się z Google"}/>
                <input type={"button"}
                       value={"Zarejestruj się z Fb"}/>
            </form>
        </>
    )
}
